INSERT INTO `netzwerkadapter` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (1, '../img/products/Netzwerkadapter/atolla USB-LAN-Adapter.webp;', 'atolla USB-LAN-Adapter', 'https://www.amazon.de/sspa/click?ie=UTF8&spc=MTozNzI3NzAwNjk0ODQwODg2OjE2Njc1MDcwMjY6c3BfYXRmOjIwMDc0MTU5MDMyMDk4OjowOjo&sp_csd=d2lkZ2V0TmFtZT1zcF9hdGY&url=%2Fatolla-Adapter-Ethernet-Netzwerkadapter-1000Mbps%2Fdp%2FB08B668FRS%2Fref%3Dsr_1_2_sspa%3F__mk_de_DE%3D%25C3%2585M%25C3%2585%25C5%25BD%25C3%2595%25C3%2591%26crid%3D1AZVI3XA2WIME%26keywords%3Datolla%2BUSB-LAN-Adapter%26qid%3D1667507026%26sprefix%3Datolla%2Busb%252Caps%252C236%26sr%3D8-2-spons%26psc%3D1%26smid%3DAWEGLB0I71KBI', '13,99', 4.5, 931, 3, 'black;atolla;29 g;-;USB, USB 3.0;atolla;Desktop;【Hervorragende Funktionalität】- Der Atolla 2 in 1 USB LAN adapter ist mit einer USB 3.0-Schnittstelle und einem LAN-Anschluss(1000 Mbit/s) ausgestattet. Im Vergleich zum WLAN stellt dieser Adapter eine zuverlässigere Verbindung her. Er bietet eine optimale Lösung für Dateiübertragung, Videokonferenzen, Computerspiele und HD-Video-Streaming, abwärtskompatibel mit Ethernet 100/10 Mbit/s.|【Umfassende Kompatibilität】- Dieser hochwertige Ethernet-Adapter ist mit Nintendo Switch, Xiaomi Mibox S / Mibox 3, Windows 10 / 8.1 / 8/7 / Vista / XP, Mac OSX 10.6 / 10.07 / 10.08 / 10.09 / 10.10 / 10.11 / 10.12 / 11.1 (oder höher Version), Chrome OS, Linux-Kernel Version 2.6.14 (oder höher Version), IEEE 802.3, IEEE 802.3u, IEEE 802.3ab und IEEE 802.3az (Energiesparendes Ethernet) kompatibel. Hinweis: ※ Unterstützt Wii / Wii U / Windows RT|【Plug und Play】- Unterstützung von Wake on LAN (WOL), Crossover-Erkennung, Ethernet-Vollduplex (FDX) und Halbduplex (HDX), automatischer Mdix- und TCP-Offload-Engine (TOE) für IPv4 / IPv6. Hinweis: ※ Für die Betriebssystem Windows XP, VISTAR, Windows 7 sollten Sie den Treiber von unserer Website (www.atolla.us) heruntergeladen und installieren.|【Type-A auf Type-C Adapter】- Mit dem mitgelieferten Adapter (Type-A auf Type-C) verbinden Sie problemlos die gängigen Type C und USB Type A-fähigen Geräte wie beispielsweise MacBook, MacBook Pro, MacBook AIR, Surface Pro7, Dell XPS13 / 15, Huawei P20 / P30 / Mate20, Samsung NOTE8 / 9, Samsung S8 / 9 und die gängigen Android-Tablets mit einem Netzwerk. Hinweis: ※ Nicht kompatibel mit Handys, die kein Ethernet unterstützen.|【Sorgfältiges Design】- Die LED-Anzeigen neben der RJ45 Schnittstelle zeigen den Betriebsstatus. (Wenn Sie den Adapter an den Computer anschließen, leuchtet die LED-Anzeige grün. Wenn die Verbindung einwandfrei funktioniert, blinkt die LED-Anzeige gelb). Mit seiner kompakten Abmessung ist der Atolla Adapter ideal für unterwegs und passt in jede Handtasche.');
INSERT INTO `netzwerkadapter` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (2, '../img/products/Netzwerkadapter/UGREEN USB LAN Adapter.webp;', 'UGREEN USB LAN Adapter', 'https://www.amazon.de/UGREEN-Netzwerk-Ethernet-kompatibel-unterst%C3%BCtzt/dp/B00MYT481C/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=285V9YORD4KKH&keywords=UGREEN+USB+LAN+Adapter&qid=1667507036&qu=eyJxc2MiOiIyLjIxIiwicXNhIjoiMS44OCIsInFzcCI6IjEuNzQifQ%3D%3D&sprefix=%2Caps%2C91&sr=8-3', '13,99', 4.6, 25411, 1, 'black;-;-;-;-;-;kompatibel mit Windows 11/ 10/ 8.1/ 8/ 7/ Vista/ XP, Mac OS, Linux, Wii, Wii U, Mi Box;Gute Lösung für Netzwerkverbindung: USB LAN Adapter hilft Ihnen, einen beschädigten Ethernet-Port durch einen USB Port zu ersetzen oder Ihrem PC/Laptop/Mac Book/Mi Box/Wii U/Ultrabook einen externen RJ45-Stecker für Datenübertragung, Videokonferenz, Spiele und HD-Videostreaming hinzuzufügen.|Hervorragende Stabilität: Dieser USB Ethernet Adapter unterstützt die Geschwindigkeit von 480/100 Mbps. Mit sicherem Chipsatz AX88772A und dem USB Port können Sie eine stabilere und zuverlässigere Verbindung als die meisten WLAN genießen.|Starke Kompatibilität: Plug and Play unter Windows 11/10/8.1/8, Mac OS X 10.5 - 10.10. Unter Linux Kernel 3.x/2.6.x, Windows 7/XP/Vista 32/64-bit ist die Treiberinstalltion erforderlich.|LED-Anzeige: Mit 2 LED-Anzeige lässt sich der Arbeitsstatus deutlich anzeigen. Das Grünes leuchtet, wenn Sie ihn an den Computer anschließen. Das Gelbes flackert, wenn der USB Netzwerkdapter einwandfrei funktioniert.|Kompaktes Design: Der LAN Kabel Adapter verfügt über kompakte Größe und passende Kabellänge, nehmen Sie ihn einfach in Ihrer Tasche immer mit, egal unterwegs oder auf Reisen.');
INSERT INTO `netzwerkadapter` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (3, '../img/products/Netzwerkadapter/Techkey USB LAN Adapter.webp;', 'Techkey USB LAN Adapter', 'https://www.amazon.de/Techkey-Adapter-1200Mbit-Dualband-Antennen/dp/B07FDSLCBR/ref=sr_1_4?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2FUI1WLHWDACB&keywords=Techkey+USB+LAN+Adapter&qid=1667507047&sprefix=te%2Caps%2C157&sr=8-4', '22,99', 4.1, 7894, 0, '-;Techkey;45.4 g;1200 MB;USB;Techkey;Desktop;Hohe WiFi-Geschwindigkeit: Die WLAN-Geschwindigkeit kann im 5,8-GHz-WiFi-Band bis zu 867 Mbit / s oder im 2,42-GHz-WiFi-Band bis zu 300 Mbit / s betragen. Es ist ideal für 4K HD-Video-Streaming, Online-Spiele und Audio, Musik. Mit der USB 3.0-Schnittstelle ist es zehnmal schneller als USB 2.0.|Dual 5-dBi-Antennen: Mit zwei 5-dBi-Fern- und High-Gain-WLAN-Antennen bietet der Techkey WiFi adapter eine höhere Stabilität des drahtlosen Empfangs und eine größere Netzwerkabdeckung. Der USB-LAN-Adapter hat seine Fähigkeit zum Empfangen und Senden von Signalen verbessert.|Einfache Installation: Sie können den Treiber einfach über die Mini-CD installieren oder über den im Benutzerhandbuch angegebenen Treiberlink herunterladen. Nach der Installation des Treibers können Sie eine schnellere Netzwerkverbindung herstellen.|Soft-AP-Funktion: Mit dieser Soft-AP-Funktion können Sie Hotspots erstellen, wenn Ihr Computer mit einem kabelgebundenen Netzwerk verbunden ist. Auf diese Weise können Sie mehr elektronische Geräte an das Netzwerk anschließen.|Breite Kompatibilität: Kompatibel mit Windows 11 / 10/ 8/ 7 / Vista / XP, MAC OS 10.9-10.15');
INSERT INTO `netzwerkadapter` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (4, '../img/products/Netzwerkadapter/FITLONG USB C Hub.webp;', 'FITLONG USB C Hub', 'https://www.amazon.de/FITLONG-Adapter-kompatibel-MacBook-Kartenleser-Gray/dp/B09FZKT5TH/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2I9MVFM9OHMUF&keywords=FITLONG+USB+C+Hub&qid=1667507057&qu=eyJxc2MiOiIyLjM5IiwicXNhIjoiMS4xOSIsInFzcCI6IjAuODkifQ%3D%3D&sprefix=fit+long+usb+c+hub%2Caps%2C150&sr=8-3', '24,99', 4.3, 1351, 2, '-;FITLONG;-;500 Megabytes Per Second;HDMI;-;<span class="a-truncate" data-a-word-break="normal" data-a-max-rows="3" data-a-overflow-marker="&amp;hellip;" style="line-height: 1.3em !important; max-height: 3.9em;" data-a-recalculate="false" data-a-updated="true"><span class="a-truncate-full a-offscreen">MacBook Pro, MacBook Air, Surface Book 2 / Go, Microsoft lumia 950/950XL , Dell XPS Chromebook Pixel / Pixelbook, HP Spectre X360, Lenovo Yoga 910, Asus ZenBook UX390UAK, Nintendo, Samsung Galaxy S8 or later, Note 8 or later, Lumia 950 / 950XL , HTC U11, pad pro 2018(pad pro only for display)</span><span class="a-truncate-cut" aria-hidden="true" style="height: 3.9em;">MacBook Pro, MacBook Air, Surface Book 2 / Go, Microsoft lumia 950/950XL , Dell XPS Chromebook Pixel / Pixelbook, HP Spectre X360, Lenovo Yoga 910, Asus ZenBook UX390UAK, Nintendo, Sam…</span></span>;[ Vielfältige Funktionen - 6 in 1 ] FITLONG USB C Hub kombiniert 6 der am häufigsten verwendeten Ports. Typ C Hub mit 1 * 4K HDMI Port, 2 * USB Ports, 1 * PD-Ladeport, SD / microSD / TF-Kartensteckplätzen. Plug-and-Play, ohne die Notwendigkeit, Treiber zu installieren. Alle 6 Ports ermöglichen gleichzeitiges Anschließen, Erfüllen Sie alle Ihre Bedürfnisse bei der Arbeit und erhöhen Sie die Effizienz Ihrer Arbeit.|[ Ultra High Speed Datenübertragung ] Mit 2 USB Anschlüssen können Festplatte, Drucker, Maus und weitere USB Geräte an MacBook Pro oder MacBook Air angeschloßen werden. Die Datenübertragungsgeschwindigkeit ist von bis zu 5 Gbps. Super Schnell, um Dateien, Videos, Fotos, HD-Filme von Ihrem festplatte auf Typ-C-Laptop in Sekunden zu übertragen, ohne zu warten.Datenübertragung von SD/ microSD/ TF-Karten, Der USB C Hub bietet ein effizientes Foto-Sharing-Erlebnis.|[ 4K HD-Videoausgang ] Das USB C Docking unterstützt eine hohe Auflösung von bis zu 4K 3840 x 2160 @ 30Hz und streamen Sie 4K oder Full HD 1080p Video direkt auf HDTV, Monitor oder Projektor.|[ 100W PD für langen Betrieb ] Der USB C Hub mit Power Delivery.Durch den USB C Ladeanschluss könnte das Laptop aufgeladen werden, während das USB C Port am Laptop belegt wird. Die maximale Leistung kann 87W erreichen. 13W davon wird für den Betrieb des USB C Hubs vorbereitet. Mit dem PD Port wird Wärme nach langem Betrieb nicht weiter entwickelt, gibt der Hub gleichzeitige Lademöglichkeit während paralleler Filmausgabe über USB-C an HDMI.|[ Breite Kompatibilität ] Der USB C Hub HDMI ist kompatibel mit neuen Laptops, Tablets und Smartphones mit USB-C-Anschluss: MacBook Pro / Air 2021/2020/2019/2018, Pad Pro / Air, Samsung Galaxy S8/S9, HUAWEI Mate40/P40, XiaoMi usw. Ideal als MacBook/ USB C Hub/ USB C Laptop Hub kompatibel mit Windows XP/7/8/10/ Vista/ Chrome OS/ Mac OS/ Linux/ Android usw.Der Typ C Hub unterstützt auch OTG-Funktion, mit der Sie Dateien / Bilder / Videos direkt vom USB-Stick auf Ihr Smartphone übertragen können.');
INSERT INTO `netzwerkadapter` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (5, '../img/products/Netzwerkadapter/uni USB-Ethernet-Adapter.webp;', 'uni USB-Ethernet-Adapter', 'https://www.amazon.de/sspa/click?ie=UTF8&spc=MTo0MTA1ODU5MTg0ODMzMDk6MTY2NzUwNzA2NTpzcF9hdGY6MjAwMzczNjk5ODc5OTg6OjA6Og&sp_csd=d2lkZ2V0TmFtZT1zcF9hdGY&url=%2FEthernet-Netzwerkadapter-1000Mbps-kompatibel-Nintendo%2Fdp%2FB09HGZ2XXQ%2Fref%3Dsr_1_1_sspa%3F__mk_de_DE%3D%25C3%2585M%25C3%2585%25C5%25BD%25C3%2595%25C3%2591%26crid%3DVIPNIJ6P8HD%26keywords%3Duni%2BUSB-Ethernet-Adapter%26qid%3D1667507065%26sprefix%3Duni%2Busb-e%252Caps%252C110%26sr%3D8-1-spons%26psc%3D1', '13,99', 4.6, 379, 0, 'grey;uni;41 g;1000 Megabits Per Second;USB;uni;Laptop;【Super-Speed USB Lan Adapter】uni USB 3.0 Ethernet Adapter unterstützt eine hohe Geschwindigkeit von 1000 Mbps, ist abwärtskompatibel mit 100 Mbps/10 Mbps und viel schneller als USB 2.0. Damit können Sie 1G-Film in 10 Sekunden hrunterladen und die flüssige Netzwerkgeschwindigkeit genießen.|【Stabilere Internet-Verbindung】Es bietet Ihnen ein zuverlässigeres Internet als drahtlose WLAN-Verbindung für Ihren PC/Laptop/Mac Book/Xiaomi Mi Box/Wii U/Ultrabook. Keine Verzögerung, keine Störungen und weniger Interferenzen. Egal ob Sie spielen auf Switch oder fernsehen mit TV Box, brauchen Sie keine Sorge um die Latenz.|【Breite Kompatibilität】Plug und Play, keine Treiberinstallation erforderlich. Kompatibel mit Windows 2003, XP, Vista, 2008_32bit und Windows7/8/8.1/10/11, Mac / Linux usw. Unterstützt Kreuzerkennung, automatische Korrektur und WOL.(nicht kompatibel mit Apples M2-Serie)|【Kompaktes und freundliches Design】Starkes und flexibeles geflochtenes Nylonkabel hat 10.000+ Biegetest bestanden. Premium Aluminiumgehäuse für bessere Kühlung und Haltbarkeit. Kompakt und leicht genug, überall und jederzeit eine Verbindung herstellen. Der hochwertige USB-A-Anschluss lässt sich sicher in Ihr Gerät einstecken und sorgt für ein stabiles Signal.|【Verlässliche uni-Garantie】Zuverlässige Qualität und eine 18-monatige Garantie sorgen für langfristige Zufriedenheit; freundlicher 24/7 Kundendienst und effektive Antworten lösen Ihre Probleme und Sorgen in kürzester Zeit.');
INSERT INTO `netzwerkadapter` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (6, '../img/products/Netzwerkadapter/CableCreation USB 3.0 LAN-Adapter.webp;', 'CableCreation USB 3.0 LAN-Adapter', 'https://www.amazon.de/sspa/click?ie=UTF8&spc=MToyMzM2NjkxMzU5MTkwNTc1OjE2Njc1MDcwNzg6c3BfYXRmOjIwMDQyMjIzMzcyNjAyOjowOjo&sp_csd=d2lkZ2V0TmFtZT1zcF9hdGY&url=%2FCableCreation-%25C3%25BCberzogenes-RJ45-Gigabit-Ethernet-Adapter-Treibersoftware-erforderlich-Black%2Fdp%2FB013G4C8RE%2Fref%3Dsr_1_1_sspa%3F__mk_de_DE%3D%25C3%2585M%25C3%2585%25C5%25BD%25C3%2595%25C3%2591%26crid%3D3G9YXSYWEWNNU%26keywords%3DCableCreation%2BUSB%2B3.0%2BLAN-Adapter%26qid%3D1667507078%26qu%3DeyJxc2MiOiIxLjAyIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%253D%253D%26sprefix%3Dcablecrea%252Caps%252C124%26sr%3D8-1-spons%26psc%3D1', '16,99', 4.6, 4993, 0, 'black;CableCreation;10 g;1 Gigabits Per Second;USB, Ethernet, USB 3.0, USB 2.0;CableCreation;PC;➤Der&nbsp;USB&nbsp;3.0-Ethernet-Adapter&nbsp;fügt&nbsp;Ihrem&nbsp;Ultrabook-Notebook&nbsp;einen&nbsp;Standard-RJ45-Anschluss&nbsp;hinzu,&nbsp;der&nbsp;10/100/1000&nbsp;Mbit/s&nbsp;unterstützt.&nbsp;Mit&nbsp;sicherem&nbsp;und&nbsp;stabilem Chipsatz.&nbsp;Abwärtskom-patibel&nbsp;mit&nbsp;2.0&nbsp;/&nbsp;1.1-Standards.|➤Unterstützt&nbsp;Crossover-Erkennung,&nbsp;Autokorrektur&nbsp;und&nbsp;Wake-on-LAN&nbsp;(WOL).&nbsp;Unterstützt&nbsp;Windows&nbsp;(32/64&nbsp;Bit)&nbsp;8/7&nbsp;/&nbsp;Vista&nbsp;/&nbsp;XP,&nbsp;Mac&nbsp;OS&nbsp;10.5&nbsp;/&nbsp;10.6/10.7/10.8/10.9/10.10/10.12.&nbsp;Unterstützt&nbsp;kein&nbsp;Windows&nbsp;RT-&nbsp;oder&nbsp;Android-System.|➤Plug and Play nach einmaliger Installation des Treibers;&nbsp;Treiberfrei&nbsp;für&nbsp;Windows&nbsp;8&nbsp;/&nbsp;8.1&nbsp;/&nbsp;10 / 11;&nbsp;Treiberinstallation&nbsp;für&nbsp;Windows&nbsp;7&nbsp;/&nbsp;XP&nbsp;/&nbsp;Vista&nbsp;/&nbsp;Mac&nbsp;OS&nbsp;/&nbsp;Linux&nbsp;erforderlich;&nbsp;Unterstützt&nbsp;Gegendruckrouting&nbsp;und&nbsp;IEEE&nbsp;802.3x-Flusskontrolle&nbsp;für&nbsp;Vollduplex-&nbsp;(FDX)&nbsp;und&nbsp;Halbduplex-&nbsp;(HDX)&nbsp;Systeme.&nbsp;Kompatibel&nbsp;mit&nbsp;IEEE&nbsp;802.3,&nbsp;IEEE&nbsp;802.3u&nbsp;und&nbsp;IEEE&nbsp;802.3ab.&nbsp;Unterstützt&nbsp;IEEE&nbsp;802.3az|➤Hohe Geschwindigkeit: hohen Bandbreite ,Super Speed , USB 3.0 Schnittstelle bis zu 5 GBit / s ,es bietet der USB 3.0-zu-Ethernet-Adapter eine zukunftssichere Netzwerkverbindung mit 1000 MBit / s Ethernet und eine Abwärtskompatibilität mit 10/100 MBit / s Ethernet|➤Was Sie bekommen: CableCreation USB Netzwerkadapter mit zwei Jahre Garantie und freundlichen Kundenservice. Wenn Sie irgendwelche Problem haben, zögern Sie bitte nicht, uns zu informieren.');
INSERT INTO `netzwerkadapter` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (7, '../img/products/Netzwerkadapter/CSL USB 3.0 auf RJ45 Fast Ethernet Adapter.webp;', 'CSL USB 3.0 auf RJ45 Fast Ethernet Adapter', 'https://www.amazon.de/CSL-Ethernet-kompatibel-Netzwerkkarte-Konverter-B/dp/B09JGQLPXV/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2F3YKV15BHN1Y&keywords=CSL+USB+3.0+auf+RJ45+Fast+Ethernet+Adapter&qid=1667507090&sprefix=csl+usb+3.0+auf+rj4%2Caps%2C114&sr=8-3', '13,85', 4.1, 8, 0, '-;CSL-Computer;-;-;USB, Ethernet;-;Laptop;Viele Notebooks besitzen keinen Eingang für einen Ethernet-Stecker und können nur noch über WLAN ins Netzwerk eingebunden werden. Wer beim Streamen und Online-Gaming sicherstellen möchte, dass nichts anbrennt, greift auf den USB-Ethernet-Adapter von Primewire zurück. Er stattet Ihr Notebook und MacBook mit einem Fast-Ethernet-Port aus und gewährleistet dank USB 3.2 Gen1 und einer LAN-Geschwindigkeit von bis zu 1000 Mbit/s eine schnelle und sichere Verbindung. | 303256|Schließen Sie einfach den Adapter an einen freien USB Port Ihres Computers an. Auf aktuellen Betriebssystemen wird er ohne weitere Treiberinstallation erkannt. Schon sind Sie per stabiler LAN-Verbindung online. Der Adapter nutzt automatisch die maximal zur Verfügung stehende Netzwerkgeschwindigkeit. Zwei LEDs informieren über den Betriebszustand: Grün = Netzwerkverbindung; Gelb (blinkend)= Datenübertragung.|Der Adapter ist außerdem mit der Switch kompatibel. Ab sofort können Sie mit der Switch online spielen und eine schnelle und störungsfreie Verbindung genießen.|Kompatible Betriebssysteme: Ohne Treiber einsetzbar: Microsoft Windows 8/ 8.1/ 10/ 11; Apple Mac OS X 10.6 oder höher | Treiber benötigt: Windows 7 und älter / Mac OS 10.5 und älter | Nicht kompatibel: Windows RT, Android | Hinweis: Eine freie USB-Buchse muss vorhanden sein. | Nicht mit der Switch LITE kompatibel, da diese nur den Handheld-Modus bietet und nicht mit dem Dock kompatibel ist.|Schnittstellen: USB 3.2 Gen1 Super Speed Typ A-Stecker auf RJ45-Buchse (10/100/1000 Mbit) | Unterstützt IEEE 802.3, 802.3u und 802.3ab (10BASE-T, 100BASE-TX und 1000BASE-T) | unterstützt Wake-on-LAN (WOL), Full-Duplex (FDX) und Halfduplex (HDX) Ethernet, Crossover-Erkennung, Auto-Korrektur (Auto MDIX) sowie IPv4/IPv6-Protokolle.');
INSERT INTO `netzwerkadapter` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (8, '../img/products/Netzwerkadapter/Benfei Netzwerkadapter.webp;', 'Benfei Netzwerkadapter', 'https://www.amazon.de/Ethernet-BENFEI-Netzwerkadapter-Kompatibel-geflochten/dp/B08KWC7D78/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=39AH9CNGRVYQ3&keywords=Benfei+Netzwerkadapter&qid=1667507096&sprefix=%2Caps%2C72&sr=8-3', '14,95', 4.5, 2790, 0, 'black,grey;BENFEI;25 Gramm;5 Gigabits Per Second;USB, Ethernet, USB 3.0, USB 2.0;-;Laptop, Desktop, Tablet;KOMPAKTES DESIGN - Der tragbare USB-zu-Ethernet-Adapter von Benfei im kompakten Design verbindet Ihren Computer oder Ihr Tablet mit einem Router, Modem oder Netzwerk-Switch für die Netzwerkverbindung. Es fügt Ihrem Ultrabook, Notebook oder Macbook Air einen standardmäßigen RJ45-Anschluss für Dateiübertragungen, Videokonferenzen, Spiele und HD-Videostreaming hinzu.|ÜBERLEGENE STABILITÄT - Der eingebaute fortschrittliche IC-Chip fungiert als Brücke zwischen dem RJ45-Ethernet-Kabel und Ihren USB 3.0-Geräten. Die treiberfreie Installation mit nativer Treiberunterstützung in Chrome, Mac und Windows OS; Der USB-Ethernet-Adapter-Dongle unterstützt wichtige Leistungsmerkmale wie Wake-on-Lan (WoL), Full-Duplex (FDX) und Half-Duplex (HDX) Ethernet, Crossover-Erkennung, Backpressure Routing, Auto-Correction (Auto MDIX)|UNGLAUBLICHE LEISTUNG - Unterstützt volle 10/100/1000 Mbit/s Gigabit-Ethernet-Leistung über den 5-Gbit/s-Bus von USB 3.0, schneller und zuverlässiger als die meisten drahtlosen Verbindungen. Verbindungs- und Aktivitäts-LEDs. Stromversorgung über USB, keine externe Stromversorgung erforderlich. Abwärtskompatibel mit USB 2.0/1.1.|BREITE KOMPATIBILITÄT - Der USB-Ethernet-Adapter ist kompatibel mit Windows 8.1/8/7/Vista/XP, Mac OSX 10.6/10.7/10.8/10.9/10.10/10.11/10.12, Linux Kernel 3.x/2.6 und Chrome OS. *Windows RT und Android werden nicht unterstützt. Kompatibel mit IEEE 802.3, IEEE 802.3u und IEEE 802.3ab. Unterstützt IEEE 802.3az (Energieeffizientes Ethernet).|18 MONATE GARANTIE - Die exklusive bedingungslose 18-monatige Garantie von Benfei gewährleistet eine langfristige Zufriedenheit mit Ihrem Kauf; Freundlicher und leicht erreichbarer Kundenservice, um Ihre Probleme rechtzeitig zu lösen');
INSERT INTO `netzwerkadapter` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (9, '../img/products/Netzwerkadapter/Rankie USB Netzwerkadapter.webp;', 'Rankie USB Netzwerkadapter', 'https://www.amazon.de/Rankie-Netzwerkadapter-Ethernet-Netzwerk-Konverter/dp/B010SEARPU/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=142SVGPZZGYOQ&keywords=Rankie+USB+Netzwerkadapter&qid=1667507103&qu=eyJxc2MiOiIxLjAyIiwicXNhIjoiMC4yMyIsInFzcCI6IjAuMzkifQ%3D%3D&sprefix=rankie+usb+net%2Caps%2C96&sr=8-3', '13,99', 4.6, 14803, 0, 'black;Rankie;45 g;5000 Megabits Per Second;USB 3.0;Rankie;Laptop, Desktop, Tablet;Hinweis: nicht kompatibel mit Nintendo Switch. Portable USB-zu-Ethernet-Adapter verbindet einen USB 3.0 (abwärtskompatibel mit USB 2.0) ausgestattet Computer oder Tablet an einen Router, Modem oder Netzwerk-Switch zu Gigabit Ethernet, um die Netzwerkverbindung zu bringen; A Cat6-Ethernet-Kabel (separat erhältlich) wird empfohlen,|Nutzt die hohe Bandbreite von Superspeed USB 3.0-Schnittstelle mit bis zu 5 Gbps, dieses USB 3.0-zu-Ethernet-Adapter zukunftssicher Ihre Netzwerkverbindung mit 1000 Mbps Ethernet, während hält eine Abwärtskompatibilität mit 10/100 Mbps Ethernet|Diese leichte USB-Netzwerkadapter, um eine perfekte Zubehör für das Hinzufügen eines Standard-RJ45-Port, um Ihre Ultrabook, Notebook oder Macbook Air für Dateiübertragung, Video-Conferencing, Spiele und HD-Video-Streaming|Unterstützte Features sind Wake-on-LAN (WOL), Full-Duplex (FDX) und Halbduplex (HDX) Ethernet, Crossover-Erkennung, Gegendruck Routing, Auto-Korrektur (Auto MDIX). Unterstützt IPv4 / IPv6-Protokolle und 10BASE-T, 100BASE-TX und 1000BASE-T-Netzwerke|Verdrahtet USB-Ethernet-Verbindung ist schneller und zuverlässiger als drahtloses Netzwerk. Diese Ethernet-USB-Adapter ist mit Windows 8.1 / 8/7 / Vista / XP, Mac OSX 10,6 / 10,7 / 10,8 / 10,9 / 10,10, und Chrome OS kompatibel mit neuesten System-Updates. Unterstützt Windows RT oder Android');
INSERT INTO `netzwerkadapter` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (10, '../img/products/Netzwerkadapter/atolla USB 3.0 auf RJ45 Gigabit Ethernet 301.webp;', 'atolla USB 3.0 auf RJ45 Gigabit Ethernet 301', 'https://www.amazon.de/USB-3-0-RJ45-Gigabit-Ethernet/dp/B01LWWGQA3/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=MBGEJWNG6XLS&keywords=atolla+USB+3.0+auf+RJ45+Gigabit+Ethernet+301&qid=1667507111&qu=eyJxc2MiOiIwLjAwIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=atolla+usb+3.0+auf%2Caps%2C106&sr=8-3', '29,68', 4.5, 1858, 0, 'black;atolla;60 g;-;Ethernet, USB 3.0;Ruiwei;chromebook,surface,macbook,macbook air,iMac,PC portables;1.Aluminium-Magnesium-Legierung Material mit matter Oberfläche verwenden, polierte Schnittstelle ermöglicht Atolla USB Ethernet Adapter Struktur fester, einfacher und eleganter.Ein integrales Design, USB 3.0 Kable von 13 cm eingebaut, ist einfach zu tragen.|2.USB-Anschluss: 3 USB3.0 Erweiterungsports, schnelle Datenübertragung mit 5Gbps unterstützen.Gerät mit eigener Stromversorgung, gilt für die Zugangsgeräte mit geringem Stromverbrauch, wie z.B. Maus, Tastatur und U-Disk.|3.Gigabit LAN: Bis auf Gigabit LAN aktualisieren, HD-Video und Spiel besser erleben.10/100/1000M Netzwerk-Adapter, IEEE 802.3 x Vollduplex (FDX) Halbduplex (HDX) unterstützen.|4.Betriebssystem:Windows: Windows 10, Windows 8.1, Windows 8, Windows 7, Windows Vista, Windows XP Mac: Mac OS X (10.5/10.6/10.7/10.8/10.9/10.10).Hinweis: Mac OS X (10.5-10.8) braucht das Laufwerk zu installieren. Linux: kernels 3.0 und aktueller|5.Industrieführender USB 3.1 Chip: GL3520 Kontroll-Chip verwenden, Windows Hardware zertifiziert, pefekt kompatibel mit Surface.BC1.2 Internationale Ladespezifikation erfüllen, sichere und effektive Ladefunktion zur Verfügung stellen');
