32/64 Bit), Windows 11 (32/64 Bit), Linux und MacOS X 10.6 oder höher | Kabellänge: ca. 35 cm, Gesamtlänge ca. 45 cm | Abmessungen: 5,7 cm x 2,6 cm x 1,7 cm (LxBxH) | Gewicht: 40 g | Farbe: silber (matt) | Material: Aluminium | Lieferumfang: CSL - USB 3.2 Gen1 SuperSpeed Gigabit Ethernet/Netzwerkadapter (RJ45) extern + Bedienungsanleitung');
